import React from 'react';
import styles from './header.css';

let Header =  {
        render() {
        return(
            <div className={styles.header}>
            <h1 className="title">The INFO6150 News</h1>
            <time datetime="02-20-2019">Wed, February 20, 2019</time>
            </div> 
        );
        }  
}

export default Header;
